    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 544,
           NT_OFFSET         = 122,
           LA_STATE_OFFSET   = 5864,
           MAX_LA            = 2147483647,
           NUM_RULES         = 534,
           NUM_NONTERMINALS  = 201,
           NUM_SYMBOLS       = 323,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 3754,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 120,
           EOLT_SYMBOL       = 120,
           ACCEPT_ACTION     = 4965,
           ERROR_ACTION      = 5330;

